oxy_webhelp_navlinks = {"tocId-d269e126":{"topics":[{"title":"Daily Routine: Feeding, Exercise, and Potty","shortdesc":"<p class=\"shortdesc\">     Cerberus thrives with a consistent daily schedule to balance his energy, meet his core needs, and build trust.   <\/p>","href":"Reference-Daily-Routine.html","attributes":{"data-id":"Daily-Routine"},"menu":{"hasChildren":false},"tocID":"Daily-Routine-d269e127","topics":[]},{"title":"How to Crate Train Cerberus","shortdesc":"<p class=\"shortdesc\">     Help Cerberus build a positive, voluntary relationship with the crate without using force or confinement.      This is especially important because he has a history of anxiety around crates.   <\/p>","href":"Task-How-to-Crate-Train.html","attributes":{"data-id":"crate-training"},"menu":{"hasChildren":false},"tocID":"crate-training-d269e138","topics":[]},{"title":"How to Make Frozen Treats for Cerberus","shortdesc":"<p class=\"shortdesc\">Offer Cerberus a calming, mentally stimulating activity that also supports digestion and routine. These frozen treats are helpful during crate time, transitions, or when he’s extra energetic and needs a healthy outlet.<\/p>","href":"Task-How-to-Make-Frozen-Treats.html","attributes":{"data-id":"How-to-make-frozen-treats"},"menu":{"hasChildren":false},"tocID":"How-to-make-frozen-treats-d269e149","topics":[]},{"title":"How to Introduce Cerberus to a Cat","shortdesc":"<p class=\"shortdesc\">     Cerberus is best suited in a cat-free home. However, Cerberus may be able to coexist with a cat through proper training and gradual and monitored introductions.      This guide does not guarantee that Cerberus will be able to coexist with a resident cat.   <\/p>","href":"Task-How-to-Introduce-Cerberus-to-a-Cat.html","attributes":{"data-id":"Cat-Cerberus-Introduction"},"menu":{"hasChildren":false},"tocID":"Cat-Cerberus-Introduction-d269e160","topics":[]},{"title":"Cerberus Health and Vaccination Record","shortdesc":"<p class=\"shortdesc\">This record shows Cerberus’s medical history, vaccination dates, and treatments for easy sharing with fosters, adopters, and vets.<\/p>","href":"Reference-Cerberus-Health-and-Vaccination-Record.html","attributes":{"data-id":"cerberus-health-record"},"menu":{"hasChildren":false},"tocID":"cerberus-health-record-d269e171","topics":[]}]}};